import React from 'react';

import AppLayout from '../components/AppLayout';

const Home = () => {
    return (
        <AppLayout headerType={0}>
            <main style={{
                minHeight:viewHeight,
                background: `no-repeat center/100% url('/img/main_back_img.jpg')`,
                opacity: '0.85',
                }}>
                {children}
            </main>
        </AppLayout>
    );
};

export default Home;
